import { GET_LIST_USERS, MODAL_POP_UP } from "../modules/Home/actions";

const initialState = {
  listUsers: [],
  modalPopUp: false,
};

export const homeReducer = (state = initialState, action) => {
  switch (action.type) {
    case GET_LIST_USERS:
      return { listUsers: action.payload };
    case MODAL_POP_UP:
      return {
        ...state,
        modalPopUp: action.payload,
      };
    default:
      return state;
  }
};
